import React, { useState, useEffect, useContext } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../contexts/AuthContext';

const Dashboard = () => {
  const { currentUser, authFetch } = useContext(AuthContext);
  const [properties, setProperties] = useState([]);
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  // Mülkleri ve raporları yükle
  useEffect(() => {
    const fetchData = async () => {
      try {
        // Mülkleri getir
        const propertiesResponse = await authFetch('http://localhost:8080/api/properties');

        if (!propertiesResponse.ok) {
          throw new Error('Mülkler yüklenirken bir hata oluştu');
        }

        const propertiesData = await propertiesResponse.json();
        setProperties(propertiesData);

        // Raporları getir
        const reportsResponse = await authFetch('http://localhost:8080/api/reports');

        if (!reportsResponse.ok) {
          throw new Error('Raporlar yüklenirken bir hata oluştu');
        }

        const reportsData = await reportsResponse.json();
        setReports(reportsData);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [authFetch]);

  if (loading) {
    return <div className="text-center py-8">Yükleniyor...</div>;
  }

  return (
    <div>
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold">Dashboard</h1>
        <Link to="/properties/new" className="btn-primary">
          Yeni Mülk Ekle
        </Link>
      </div>

      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
          {error}
        </div>
      )}

      <div className="mb-8">
        <h2 className="text-xl font-semibold mb-4">Mülkleriniz</h2>

        {properties.length === 0 ? (
          <div className="card text-center py-8">
            <p className="text-gray-600 mb-4">Henüz mülk eklemediniz.</p>
            <Link to="/properties/new" className="btn-primary">
              İlk Mülkü Ekle
            </Link>
          </div>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
            {properties.map((property) => (
              <div key={property.id} className="card">
                <h3 className="font-medium mb-2">{property.address}</h3>
                <p className="text-gray-600 text-sm mb-4">{property.city}</p>
                <p className="text-sm mb-2">
                  <span className="font-medium">Ev Sahibi:</span> {property.landlordName}
                </p>
                <div className="mt-4">
                  <Link
                    to={`/properties/${property.id}/reports/new`}
                    className="text-primary-600 hover:underline text-sm"
                  >
                    Yeni Rapor Oluştur
                  </Link>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>

      <div>
        <h2 className="text-xl font-semibold mb-4">Raporlarınız</h2>

        {reports.length === 0 ? (
          <div className="card text-center py-8">
            <p className="text-gray-600">Henüz rapor oluşturmadınız.</p>
            {properties.length > 0 && (
              <Link to={`/properties/${properties[0].id}/reports/new`} className="btn-primary mt-4 inline-block">
                İlk Raporu Oluştur
              </Link>
            )}
          </div>
        ) : (
          <div className="overflow-x-auto">
            <table className="min-w-full divide-y divide-gray-200">
              <thead className="bg-gray-50">
                <tr>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Mülk
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Rapor Tarihi
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    Durumu
                  </th>
                  <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                    İşlemler
                  </th>
                </tr>
              </thead>
              <tbody className="bg-white divide-y divide-gray-200">
                {reports.map((report) => {
                  const property = report.property;
                  return (
                    <tr key={report.id}>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="text-sm font-medium text-gray-900">
                          {property?.address || 'Bilinmeyen Mülk'}
                        </div>
                        <div className="text-sm text-gray-500">
                          {property?.city || ''}
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="text-sm text-gray-900">
                          {new Date(report.reportDate).toLocaleDateString('tr-TR')}
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span
                          className={`px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${
                            report.status === 'draft'
                              ? 'bg-yellow-100 text-yellow-800'
                              : report.status === 'sent'
                              ? 'bg-blue-100 text-blue-800'
                              : 'bg-green-100 text-green-800'
                          }`}
                        >
                          {report.status === 'draft'
                            ? 'Taslak'
                            : report.status === 'sent'
                            ? 'Gönderildi'
                            : 'Görüntülendi'}
                        </span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm font-medium">
                        <Link
                          to={`/reports/${report.id}`}
                          className="text-primary-600 hover:text-primary-900 mr-3"
                        >
                          Görüntüle
                        </Link>
                        {report.status === 'draft' && (
                          <Link
                            to={`/reports/${report.id}/photos`}
                            className="text-green-600 hover:text-green-900"
                          >
                            Fotoğraf Ekle
                          </Link>
                        )}
                      </td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
